script: |
  super -f text -I q4225.spq | sort > q4225.out

inputs:
  - name: q4225.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT BETWEEN col2 * - 99 * - 94 + col1 + - + ( - - CAST ( NULL AS INTEGER ) ) * + col0 * + - CAST ( + + 48 AS INTEGER ) AND + 74;
  - name: tab2

outputs:
  - name: q4225.out
    data: |
